import React from "react"
import styles from "./MenuLink.module.css"
const MenuLink = ({ name, to, hover, children }) => {
  return (
    <div
      //   onMouseEnter={hover(true)}
      onMouseLeave={() => hover()}
      className={styles.link}
    >
      <div>{name}</div>
      <div>{children}</div>
    </div>
  )
}
export default MenuLink
